// src/components/Pacientes.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
    Paper, Button, TextField, IconButton
} from '@mui/material';
import {
    Add as AddIcon, Edit as EditIcon, FileCopy as FileCopyIcon,
    Search as SearchIcon
} from '@mui/icons-material';
import { handleAddClick, handleEditClick, handleHistoryClick } from './actions';

const Pacientes = () => {
    const [data, setData] = useState([]);
    const [formData, setFormData] = useState({});
    const [showForm, setShowForm] = useState(false);
    const [showHistory, setShowHistory] = useState(false);
    const [historyData, setHistoryData] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3002/api/persona/listar');
                setData(response.data.data);
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        };

        fetchData();
    }, []);

    return (
        <Paper>
            <Button variant="contained" color="primary" startIcon={<AddIcon />} onClick={handleAddClick}>
                Agregar
            </Button>
            <TableContainer>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Opciones</TableCell>
                            <TableCell>Apellido Paterno</TableCell>
                            <TableCell>Apellido Materno</TableCell>
                            <TableCell>Nombre</TableCell>
                            <TableCell>Fecha de Nacimiento</TableCell>
                            <TableCell>Sexo</TableCell>
                            <TableCell>Estado Civil</TableCell>
                            <TableCell>Numero de Documento</TableCell>
                            <TableCell>Direccion</TableCell>
                            <TableCell>Teléfono</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map((row) => (
                            <TableRow key={row.idpersona}>
                                <TableCell>
                                    <IconButton onClick={() => handleEditClick(row.idpersona, setFormData, setShowForm)}>
                                        <EditIcon />
                                    </IconButton>
                                    <IconButton onClick={() => handleHistoryClick(row.idpersona, setHistoryData, setShowHistory)}>
                                        <FileCopyIcon />
                                    </IconButton>
                                </TableCell>
                                <TableCell>{row.apaterno}</TableCell>
                                <TableCell>{row.amaterno}</TableCell>
                                <TableCell>{row.nombre}</TableCell>
                                <TableCell>{row.fecha_nacimiento}</TableCell>
                                <TableCell>{row.sexo}</TableCell>
                                <TableCell>{row.estado_civil}</TableCell>
                                <TableCell>{row.num_documento}</TableCell>
                                <TableCell>{row.direccion}</TableCell>
                                <TableCell>{row.telefono}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
            {showForm && (
                <div>
                    {/* Aquí puedes poner el formulario de agregar/editar paciente */}
                    {/* Usar formData para pre-llenar los campos en caso de editar */}
                </div>
            )}
            {showHistory && (
                <div>
                    {/* Aquí puedes mostrar el historial del paciente */}
                </div>
            )}
        </Paper>
    );
};

export default Pacientes;
